&#x1f1ec;&#x1f1e7;
A compelling and confronting teller of stories both dreamlike and real, BABii’s nomadic and creative upbringing laid the foundations for her DIY and daring experimental approach to creation. Since her 2019 debut album <a href="spotify:album:43rBfXTncD9EecvutGmeje" data-name="HiiDE">HiiDE</a> and GLOO collective collaborative album <a href="spotify:album:5BefoLRwqaVBuQpQkNKiyO" data-name="XYZ">XYZ</a>, 2021 sophomore album <a href="spotify:album:4LOTHiQAhGiEMXMBHYev3N" data-name="MiiRROR">MiiRROR</a> and 2023 collaborative mixtape, <a href="spotify:album:1Xx8ecx9sLnnIV7eNGU8EM" data-name="SCREAMER">SCREAMER</a>, this accomplished multidisciplinary producer, songwriter, vocalist and visual artist has been consistently championed by everyone from Crack, Mixmag, Dazed, The Observer, The Line of Best Fit, i-D, NPR and on the airwaves by the likes of Tom Ravenscroft, Lauren Laverne and Jamz Supernova on BBC Radio 1, 6 Music, 1Xtra.

A conceptual artist both sonically and visually, BABii’s unique and instantly recognisable, mellifluous and nymph like vocals blended with textured and challenging productions have gained her a loyal following of fans in the industry too, leading to collaborations with the likes of Heavee, BbyMutha, Catnapp, Umru, Lil Mariko, Jianbo, TWST, Pregoblin &amp; more. She’s toured all over the world hitting festivals from Ars Electronica, Boomtown, End of The Road LEV festival, PC Music’s 10th Anniversary Party and more alongside headline tours in China, USA, UK and EU.
